const PdfPrinter = require('pdfmake');
const moment = require('moment');
const { getOneReservation } = require('../Services/reservation.service')

const fonts = {
    Roboto: {
        // fonts folder should be in the root directory
        normal: 'fonts/roboto/Roboto-Regular.ttf',
        bold: 'fonts/roboto/Roboto-Medium.ttf',
        italics: 'fonts/roboto/Roboto-Italic.ttf',
        bolditalics: 'fonts/roboto/Roboto-MediumItalic.ttf',
    },
};

module.exports = async (_Id, report) => {
    const { message } = await getOneReservation(_Id);
    const dssReports = {
        watermark: {
            text: 'www.dssguards.com',
            color: 'brown',
            opacity: 0.15,
            italics: false,
            fontSize: 50,
            angle: 60,
        },
        content: [
            {
                image: 'data:image/jpeg;base64,',
                width: 270, style: 'logo'
            },
            // { text: 'Digital Safeguard Security Inc', style: 'mainHeading' },
            { text: 'Parking Permit #', style: 'title' },
            { text: 'Visitor Information: ', style: 'subHeading' },
            {
                style: 'tableExample',
                table: {
                    body: [
                        [{ text: 'NAME', style: 'tableHeader1' }, { text: 'Email', style: 'tableHeader1' }, { text: 'Contact Number', style: 'tableHeader1' }],
                        [{ text: `${message.name}`, style: 'tableHeader1' }, { text: `${message.email}`, style: 'tableHeader1' }, { text: `${message.contactNumber}`, style: 'tableHeader1' }],

                    ],
                }

            },
            { text: 'Building Information: ', style: 'subHeading' },
            {
                style: 'tableExample',
                table: {
                    body: [
                        [{ text: 'Building Code', style: 'tableHeader2' }, { text: 'Building Address', style: 'tableHeader2' }, { text: 'Unit Visiting', style: 'tableHeader2' }],
                        [{ text: `${message.buildingCode}`, style: 'tableHeader2' }, { text: `${message.buildingAddress}`, style: 'tableHeader2' }, { text: `${message.buildingUnits}`, style: 'tableHeader2' }],

                    ],
                }

            },
            { text: 'Vehicle Information: ', style: 'subHeading' },
            {
                style: 'tableExample',
                table: {
                    body: [
                        [{ text: 'Plate Number', style: 'tableHeader3' }, { text: 'Make', style: 'tableHeader3' }, { text: 'Color', style: 'tableHeader3' }],
                        [{ text: `${message.licensedPlateNumber}`, style: 'tableHeader3' }, { text: `${message.Make}`, style: 'tableHeader3' }, { text: `${message.vehicleColor}`, style: 'tableHeader3' }],

                    ],
                }

            },
            { text: 'Reservation Date: ', style: 'subHeading' },
            {
                style: 'tableExample',
                table: {
                    body: [
                        [{ text: 'Date (From)', style: 'tableHeader4' }, { text: 'Date (To)', style: 'tableHeader4' }],
                        [{ text: `${message.dateFrom}`, style: 'tableHeader4' }, { text: `${message.dateTo}`, style: 'tableHeader4' }],

                    ],
                }

            },
            { text: 'Reservation Time: ', style: 'subHeading' },
            {
                style: 'tableExample',
                table: {
                    body: [
                        [{ text: 'Time (From)', style: 'tableHeader4' }, { text: 'Time (To)', style: 'tableHeader4' }],
                        [{ text: `${message.timeFrom}`, style: 'tableHeader4' }, { text: `${message.timeTo}`, style: 'tableHeader4' }],

                    ],
                }

            },
            { text: `www.dssguards.com`, style: 'footer' },
        ],
        styles: {
            logo: {
                margin: [130, -10, 0, 20]
            },
            title: {
                fontSize: 18,
                color: 'brown',
                marginBottom: 20,
            },
            subHeading: {
                fontSize: 14,
                color: 'green'
            },
            tableExample: {
                margin: [0, 5, 0, 15],
            },
            tableHeader1: {
                fontSize: 12,
                margin: [10, 05, 53, 05],
                color: 'black',
            },
            tableHeader2: {
                fontSize: 12,
                margin: [10, 05, 74, 05],
                color: 'black',
            },
            tableHeader3: {
                fontSize: 12,
                margin: [10, 05, 98, 05],
                color: 'black',
            },
            tableHeader4: {
                fontSize: 12,
                margin: [10, 05, 175, 05],
                color: 'black',
            },
            footer: {
                marginTop: 85,
                marginLeft: 200,
                fontSize: 14,
                color: 'blue',
            }
        }
    };
    return new Promise((resolve) => {
        const printer = new PdfPrinter(fonts);
        const pdfDoc = printer.createPdfKitDocument(dssReports);
        const chunks = [];
        pdfDoc.on('data', (chunk) => chunks.push(chunk));
        pdfDoc.on('end', () => resolve(Buffer.concat(chunks)));
        pdfDoc.end();
    });
};
